import { useEffect, useState } from "react";
function User() {
  const [user, setUser] = useState();

  useEffect(() => {
    fetch("/me")
      .then((r) => r.json())
      .then((u) => setUser(u));
  }, []);

  return (
    <div>
      {user ? (
        <div>
          <h1>{user.username}</h1>
        </div>
      ) : (
        <div>
          <h1>No User</h1>
        </div>
      )}
    </div>
  );
}

export default User;
